import Navbar from "./components/NavBar";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

export default function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<div style={{color: "black"}}>Home Page</div>} />
      </Routes>
    </Router>
  );
}
